- input:
    request:
      chat:
        - role: system
          content: Given a list of numbers and a target number, you must find a sub-list whose elements sum up to the target. Just answer with a list of numbers and nothing else.
        - role: user
          content: |-
            List: [1, 2, 3, 4]
            Target: 7
      num_completions: 1
      options: {}
      tools: []
      structured_output:
    iter: 1
  output:
    outputs:
      - content: '[3, 4]'
        logprobs:
        tool_calls: []
        finish_reason: stop
    budget:
      values:
        num_requests: 1
    log_items: []
